import React, { useState, useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';
// import '../pages/styles/Booking.css';

const BookingPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const [selectedServices, setSelectedServices] = useState([]);
  const [userDetails, setUserDetails] = useState({ name: '', phone: '', date: '', time: '' });

  // Load selected services from location state
  useEffect(() => {
    if (location.state && Array.isArray(location.state.selectedServices)) {
      setSelectedServices(location.state.selectedServices);
    } else {
      setSelectedServices([]); // Default to empty array
    }
  }, [location.state]);

  // Handle input field changes
  const handleInputChange = (e) => {
    setUserDetails({ ...userDetails, [e.target.name]: e.target.value });
  };

  // Handle appointment booking
  const handleBooking = async () => {
    if (!userDetails.name || !userDetails.phone || !userDetails.date || !userDetails.time) {
      alert('Please fill in all details.');
      return;
    }

    if (selectedServices.length === 0) {
      alert('No services selected.');
      return;
    }

    try {
      const response = await axios.post('http://localhost:5000/api/appointments/add', {
        customerName: userDetails.name,
        contactNumber: userDetails.phone,
        service: selectedServices.map(service => service._id), // Send only service IDs
        appointmentDate: userDetails.date,
        appointmentTime: userDetails.time,
      });

      if (response.status === 201) {
        alert('Appointment booked successfully!');
        navigate('/');
      } else {
        alert('Failed to book appointment, please try again.');
      }
    } catch (error) {
      console.error('Booking error:', error.response ? error.response.data : error.message);
      alert('Failed to book appointment.');
    }
  };


   
    // In your BookingPage component (add this structure)
return (
  <div className="booking-page">
    {/* Banner Section */}
    <div className="booking-banner">
      <div className="banner-content">
        <h1>Book Your Perfect Look</h1>
        <p>Expert Stylists Await You</p>
      </div>
    </div>

    {/* Content Container */}
    <div className="booking-container">
      {/* Selected Services */}
      <div className="selected-services">
        <h3>Your Selected Services</h3>
        {selectedServices.length > 0 ? (
          <ul className="services-list">
            {selectedServices.map((service, index) => (
              <li key={index}>
                <span>{service.name}</span>
                <span>₹{service.price}</span>
              </li>
            ))}
          </ul>
        ) : (
          <p className="no-services">No services selected</p>
        )}
      </div>

      {/* Borderless Form */}
      <div className="clean-form">
        <div className="form-group">
          <input
            type="text"
            name="name"
            placeholder="Full Name"
            onChange={handleInputChange}
            className="form-input"
          />
        </div>
        <div className="form-group">
          <input
            type="tel"
            name="phone"
            placeholder="Phone Number"
            onChange={handleInputChange}
            className="form-input"
          />
        </div>
        <div className="form-row">
          <div className="form-group">
            <input
              type="date"
              name="date"
              onChange={handleInputChange}
              className="form-input"
            />
          </div>
          <div className="form-group">
            <input
              type="time"
              name="time"
              onChange={handleInputChange}
              className="form-input"
            />
          </div>
        </div>
        <button className="cta-button" onClick={handleBooking}>
          Confirm Appointment
        </button>
      </div>
    </div>
  </div>
);

};

export default BookingPage;
